Southland Bounty Hunters premiered in Mayo of 2017 as an improv faux reality Bounty Hunter show where Patty Mayo and his various partners ( Bounty Hunter D, AT, Shaundra and Big E ) captured criminals on the run. The show gained huge popularity for its realism and high action. The show came to an end in December of 2019 when Patty decided to return to real bounty hunting. Southland Bounty Hunters II premiered on December 25th, 2019. The show features Patty Mayo hunting real fugitives on bond all across the United States. In mid 2020 Patty and the team returned to improv hunts due to high demand from viewers to bring back the tasers, tear gas and ass kicking. Patty Mayo took a break from the bounty hunting show in early 2020 and returned in late July while simultaneously releasing episodes of "Becoming the Seamen", a reality show documenting the life of Patty Mayo.

